import React from 'react';
import { ChevronRight, Edit3, Lock, Settings, LogOut, ArrowLeft } from 'lucide-react';

const Profile = ({ userName }) => {
  const menu = [
    { icon: <Edit3 size={18} />, label: "Edit Profile" },
    { icon: <Lock size={18} />, label: "Change Password" },
    { icon: <Settings size={18} />, label: "Settings" },
    { icon: <LogOut size={18} color="#ef4444" />, label: "Logout", color: "#ef4444" }
  ];

  return (
    <div style={{ backgroundColor: '#f8fafc', minHeight: '100vh', padding: '16px' }}>
      <ArrowLeft style={{ marginBottom: '20px' }} onClick={() => window.history.back()} />
      
      {/* User Info Card */}
      <div style={{ backgroundColor: '#fff', borderRadius: '20px', padding: '24px', textAlign: 'center', boxShadow: '0 4px 6px -1px rgba(0,0,0,0.05)' }}>
        <div style={{ width: '80px', height: '80px', borderRadius: '50%', border: '2px solid #5c5cfc', margin: '0 auto', padding: '4px' }}>
          <img src="https://via.placeholder.com/80" alt="profile" style={{ borderRadius: '50%', width: '100%' }} />
        </div>
        <h3 style={{ marginTop: '12px', fontSize: '18px', fontWeight: 'bold' }}>{userName}</h3>
        <p style={{ color: '#94a3b8', fontSize: '13px' }}>priya.sharma@university.edu</p>
        <span style={{ backgroundColor: '#5c5cfc', color: '#fff', padding: '4px 12px', borderRadius: '20px', fontSize: '12px', marginTop: '8px', display: 'inline-block' }}>Student</span>
      </div>

      {/* College Info */}
      <div style={{ backgroundColor: '#fff', borderRadius: '12px', padding: '16px', marginTop: '16px' }}>
        <div style={{ display: 'flex', justifyContent: 'space-between', fontSize: '13px', marginBottom: '8px' }}>
          <span style={{ color: '#94a3b8' }}>College Name</span>
          <span style={{ fontWeight: '600' }}>Engineering Tech Instit...</span>
        </div>
        <div style={{ display: 'flex', justifyContent: 'space-between', fontSize: '13px' }}>
          <span style={{ color: '#94a3b8' }}>Register Number</span>
          <span style={{ fontWeight: '600' }}>ETI-2023-4589</span>
        </div>
      </div>

      {/* Menu List */}
      <div style={{ marginTop: '16px' }}>
        {menu.map((item, i) => (
          <div key={i} style={{ display: 'flex', alignItems: 'center', backgroundColor: '#fff', padding: '12px 16px', borderRadius: '12px', marginBottom: '8px' }}>
            <div style={{ backgroundColor: '#f0f0ff', padding: '8px', borderRadius: '8px' }}>{item.icon}</div>
            <span style={{ flex: 1, marginLeft: '12px', fontWeight: '500', color: item.color || '#1e293b' }}>{item.label}</span>
            <ChevronRight size={18} color="#cbd5e1" />
          </div>
        ))}
      </div>
    </div>
  );
};

export default Profile;
